import React from 'react';
import backgroundImg from '../../assets/img/bg-login.jpg'

const login = () => {
  return (
    <div  styles={{ backgroundImage:`url(${backgroundImg})` }}>
        <img src={backgroundImg} />
      <h1>This is login car</h1>
    </div>
  );
}

export default login;
